import "./App.css";
import Button from "./components/Button";
import Goals from "./components/Goals";
import Header from "./components/Header";
import Searchbar from "./components/Searchbar";

function App() {
  return (
    <div className="App">
      <Header />
      <div className="main-section">
        <Searchbar />
        <Button text="Add Goal" />
      </div>
    </div>
  );
}

export default App;
